import { useState } from 'react';

import './App.css';
import Navbar from "./components/Navbar";
// import About from "./components/Abouter";
import TextForm from "./components/TextForm";
// import Abouter from './components/abouter';
import alert from "./components/alert";
function App() {
  const [darker,setdarker]=useState('light');
  const toggler=()=>{
    if(darker==='light'){
      setdarker('dark');
       document.body.style.backgroundColor="#05132a";
    }
    else{
      setdarker('light');
      document.body.style.backgroundColor="white";
    }

  }
  return (
    <> 
  <Navbar title="TextUtils" Abouttext="About" mode={darker} toggle={toggler}/>
  <alert />
  <div className="container my-3">
    <TextForm heading="TextUtils" mode={darker}/>
    {/* <About/> */}
  </div>
</>
  );
}
export default App;
